import React from 'react';
import '../App.css';

function Home() {
  return (
    <div className="home-hero">
      <div className="home-hero-content">
        <img
          src={require('../images/logo-main.jpg')?.default || require('../images/logo-main.png')?.default || require('../images/logo-main.svg')?.default}
          alt="SSE Home Decor Logo"
          className="home-logo"
          onError={e => {
            e.target.onerror = null;
            e.target.src = '';
            e.target.style.display = 'none';
          }}
        />
        <h1>Welcome to SSE Home Decor</h1>
        <p className="home-tagline">Your one-stop shop for stylish home solutions.</p>
        <p className="home-desc">Discover our range of mesh doors, mosquito nets, window blinds, and custom decor solutions to transform your living space with quality and style.</p>
        <a href="/products" className="home-cta">View Products</a>
      </div>
    </div>
  );
}

export default Home;
